import { useEffect, useState } from "react";
import Book from "../models/book";
import Navbar from "../navbarComponent/navbar";
import Footer from "../footerComponent/footer";

const CataloguePage = () => {

    const [datalibros, setDatalibros] = useState([]);
    let librosarray = new Array();

    useEffect(() => {
        const getCatalogo = () => {

            //Mocks 
            const libros = [
                {
                    titulo: "Crepusculo",
                    descripcion: "Libro de romanticismo sobrenatural.",
                    imagen: "data:image/jpeg;base64,"
                },
                {
                    titulo: "La mecanica del corazon",
                    descripcion: "Metaforas de como funciona el romance joven.",
                    imagen: "data:image/jpeg;base64,"
                },
                {
                    titulo: "El ultimo elfo",
                    descripcion: "En una tierra magica, donde solo queda un elfo capaz de salvar el mundo.",
                    imagen: "data:image/jpeg;base64,"
                },
                {
                    titulo: "Cien a√±os de soledad",
                    descripcion: "Conoceremos la tierra de Macondo junto al coronel Aureliano Buendia.",
                    imagen: "data:image/jpeg;base64,"
                }
            ];
            const jsondata = JSON.stringify(libros);
            librosarray = JSON.parse(jsondata);

            setDatalibros(librosarray);
        }

        getCatalogo();
    }, []);

    const galeria = datalibros.map(libro => {
        return (
            <div>
                <Book titulo={libro.titulo} descripcion={libro.descripcion} imagen={libro.imagen} />
            </div>
        );
    })

    return (
        <>
            <h1 className="titlePage">CATALOGO</h1>
            <Navbar />
            {galeria}
            <Footer />
        </>
    );
}

export default CataloguePage;